import React from "react";
import { IonLoading } from "@ionic/react";
import { useDispatch, useSelector } from "react-redux";
import { menssageOff } from "../../redux/actions/effects.actions";
import { efectaInitial } from "../../redux/reducers/effects";


const LoadingComp = ():React.FC => {
    const { loadding=false }:efectaInitial = useSelector((state: any) => state.effects);
    const dispatch = useDispatch();
    <IonLoading
        isOpen={loadding}
        onDidDismiss={() => dispatch(menssageOff())}
        message='cargando...'
    />
}

export default LoadingComp;
